 Для создания функции в Swift, которая сортирует массив целых чисел и выводит его на экран, можно использовать следующий код:

```swift
import Foundation

func sortAndPrintArray(of numbers: [Int]) {
    // Сортируем массив
    let sortedNumbers = numbers.sorted()

    // Выводим отсортированный массив на экран
    for number in sortedNumbers {
        print(number)
    }
}

// Пример использования функции
let exampleArray = [5, 3, 8, 4, 2, 9, 1]
sortAndPrintArray(of: exampleArray)
```

Эта функция `sortAndPrintArray` принимает массив целых чисел `numbers` в качестве параметра. Она использует метод `sorted()` для сортировки массива и затем перебирает его элементы с помощью цикла `for-in` для вывода их на экран.

 Para trabajar con los sensores de temperatura DS18B20 en un ESP32, primero necesitas instalar la biblioteca DHT en el ESP32. Puedes instalarlo a través de Arduino IDE:

1. Abre Arduino IDE y selecciona el puerto que está utilizando tu ESP32.
2. Escribe `!` y presiona `Tab` para mostrar la lista de bibliotecas disponibles.
3. Escribe `DHT` y presiona `Enter` para instalar la biblioteca DHT.

Luego, aquí tienes un ejemplo de código que muestra cómo puedes leer los datos de temperatura de un sensor DS18B20 y mostrarlos en el monitor serial:

```cpp
#include <Wire.h>
#include <DHT.h>

// Define el tipo de sensor DHT que estás utilizando
#define DHTTYPE DHT11 // Utiliza DHT11 o DHT22 (DS18B20)

// Crea una instancia del objeto DHT
DHT dht(DHT11);

void setup() {
  // Inicia la comunicación serial para mostrar los datos en el monitor
  Serial.begin(9600);

  // Inicia el sensor DHT
  dht.begin();
}

void loop() {
  // Lee la temperatura y la humedad del sensor
  float h = dht.readHumidity();
  float t = dht.readTemperature();

  // Verifica si la lectura fue exitosa
  if (isnan(h) || isnan(t)) {
    // Error al intentar leer de sensor, probablemente no esté conectado
    Serial.println("Error al leer de sensor!");
    return;
  }

  // Muestra la temperatura y la humedad en el monitor serial
  Serial.print("Temperatura: ");
  Serial.print(t);
  Serial.print(" *C Humedad: ");
  Serial.print(h);
  Serial.println(" %");

  // Espera a que la próxima lectura
  delay(2000);
}
```

Este código asume que tienes un sensor DS18B20 conectado a la patilla `D4` del ESP32 usando el bus I2C. Si estás utilizando un pin diferente, puedes cambiar el número en la función `begin()` de la instancia del objeto `dht`.

Ten en cuenta que la biblioteca `DHT.h` puede no funcionar correctamente con la versión de Arduino IDE que tienes. Si ves un error al compilar, intenta actualizar Arduino IDE a la versión más reciente.

Además, asegúrate de que tus pines del ESP32 estén correctamente configurados para el protocolo I2C y que los sensores DS18B20 estén correctamente conectados a ellos.

 Aquí tienes el algoritmo Bubble Sort implementado en C:

```c
#include <stdio.h>

void bubbleSort(int arr[], int n) {
    int i, j, temp;
    for (i = 0; i < n-1; i++) {
        for (j = 0; j < n-i-1; j++) {
            if (arr[j] > arr[j+1]) {
                // Intercambiar los elementos si están ordenados incorrectamente
                temp = arr[j];
                arr[j] = arr[j+1];
                arr[j+1] = temp;
            }
        }
    }
}

void imprimirArray(int arr[], int n) {
    int i;
    for (i=0; i < n; i++)
        printf("%d ", arr[i]);
    printf("\n");
}

int main() {
    int arr[] = {64, 34, 25, 12, 22, 11, 90};
    int n = sizeof(arr)/sizeof(arr[0]);
    bubbleSort(arr, n);
    printf("Arreglo ordenado: \n");
    imprimirArray(arr, n);
    return 0;
}
```

Este programa define dos funciones: `bubbleSort` y `imprimirArray`. La función `bubbleSort` implementa el algoritmo de ordenamiento por inserción, y la función `imprimirArray` simplemente imprime el arreglo.

En el `main` function, se crea un arreglo de enteros y se calcula su tamaño. Luego, se llama a `bubbleSort` con el arreglo y su tamaño. Finalmente, se imprime el arreglo ordenado utilizando `imprimirArray`.

