 Un condicional `if` en Java es una estructura de control que permite ejecutar un bloque de código si una condición especificada se evalúa como verdadera. La estructura general de un condicional `if` en Java es la siguiente:

```java
if (condición) {
    // Código a ejecutar si la condición es verdadera
}
```

Donde:

- `condición` es una expresión booleana que se evalúa como verdadera o falsa.
- El bloque de código entre llaves `{}` es el código que se ejecutará si la condición es verdadera.

Aquí hay un ejemplo más detallado:

```java
int numero = 10;

if (numero > 5) {
    System.out.println("El número es mayor que 5");
}
```

En este ejemplo, la condición `numero > 5` se evalúa como verdadera, por lo que el mensaje "El número es mayor que 5" se imprimirá en la consola.

También puedes anidar condicionales `if` dentro de otros condicionales `if`, lo que permite la construcción de estructuras de control más complejas. Por ejemplo:

```java
int numero = 10;

if (numero > 5) {
    System.out.println("El número es mayor que 5");
} else {
    if (numero > 10) {
        System.out.println("El número es mayor que 10");
    } else {
        System.out.println("El número es menor o igual que 10");
    }
}
```

En este caso, el mensaje "El número es mayor que 10" se imprimirá en la consola, ya que el número es mayor que 5 y menor que 10. Si el número fuera menor o igual que 10, se imprimiría el mensaje "El número es menor o igual que 10".

 Here is a JavaScript function that checks if an array of 5 numbers contains a prime number. If a prime number is found, it prints the number to the console.

```javascript
function isPrime(num) {
    if (num < 2) return false;
    for (let i = 2; i <= Math.sqrt(num); i++) {
        if (num % i === 0) return false;
    }
    return true;
}

function findPrimeInArray(arr) {
    for (let i = 0; i < arr.length; i++) {
        if (isPrime(arr[i])) {
            console.log(arr[i]);
            return;
        }
    }
}

let arr = [1, 2, 3, 4, 5];
findPrimeInArray(arr);
```

In this code, the `isPrime` function checks if a number is prime by checking if it is divisible by any number up to its square root. The `findPrimeInArray` function iterates through the array and checks each number with the `isPrime` function. If a prime number is found, it logs the number to the console and stops the function.

